function Units() {

    const units = [
        "unit",
        "g",
        "kg",
        "l",
        "ml"
    ];

    return (
        <div>
            <option value={"Select..."} disabled>Select...</option>
            {units.map((unit, index) => {
                return (
                    <option key={index}>{unit}</option>
                )
            })}
        </div>
    )
}

export default Units;
